INSERT INTO `cache_filter` VALUES ('filtered_html::0b49eff18064138e6aac42dc4b707b915b57129404aaca940073ee4b61f61112','<p>GIT Slike se bave proizvodnjom i prodajom reprodukcija umetnickih dela digitalnom stampon na slikarskom platnu CANVAS.</p>\n<p>Svaka slika proizvedena kod nas je uramljena u BLIND ram (pozadinski ram koji drzi platno zategnutim). Platno prevuceno i dodatno odstampano preko ivice rama tako da dodatno uramljivanje nije potrebno.</p>\n<p>Pored gotovih slika koje mozete pogledati u nasoj GALERIJI  radimo i SLIKE PO PORUDZBINI sa vasih fotografija.</p>\n<p>Maksimalna dimenzija stampe 70X400cm</p>\n<p>Ono sto nas izdvaja iz mora ostalih koji se bave ovim poslom je izuzetno visok kvalitet stampe i izuzetno niska cena .</p>\n<p>Izaberite sliku za Vaš zid ili savršen poklon</p>\n<p>Vršimo isporuku u sve gradove Srbije kurirskom sluzbom. Vaše je da se odlučite za sliku , da nas kontaktirate i slika je na Vašim vratima u roku od 1 dana!</p>\n',0,1498044027,0),('filtered_html::1202b4ed21aa9c412144fbbe71b70714d4fb5a2d5e6623597c2f0304f6e179fc','<p>Custom action text here.</p>\n',0,1498044027,0),('filtered_html::6d39819e3d76c9ea9866976ee3414f6766d3a34ece5a273dd8d9efa41da29977','<p>Custom text 2 here.</p>\n',0,1498044027,0);
